pragma solidity ^0.4.24;

import './SafeMath.sol';

/**
 * Welcome to the Project to share Profit from satellite Dapps
 */
contract Token {
    uint256 public totalSupply;

    function balanceOf(address who) public constant returns (uint256);
    function transfer(address to, uint256 value) public returns (bool);
    function allowance(address owner, address spender) public constant returns (uint256);
    function transferFrom(address from, address to, uint256 value) public returns (bool);
    function approve(address spender, uint256 value) public returns (bool);

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

/**
 * @title MultiOwnable
 * @dev The MultiOwnable contract has owners addresses and provides basic authorization control
 * functions, this simplifies the implementation of "users permissions".
 */
contract MultiOwnable {
    address public manager; // address used to set owners
    address[] public owners;
    mapping(address => bool) public ownerByAddress;

    event SetOwners(address[] owners);

    modifier onlyOwner() {
        require(ownerByAddress[msg.sender] == true);
        _;
    }

    /**
     * @dev MultiOwnable constructor sets the manager
     */
    constructor() public {
        manager = msg.sender;
    }

    /**
     * @dev Function to set owners addresses
     */
    function setOwners(address[] _owners) public {
        require(msg.sender == manager);
        _setOwners(_owners);

    }

    function _setOwners(address[] _owners) internal {
        for(uint256 i = 0; i < owners.length; i++) {
            ownerByAddress[owners[i]] = false;
        }


        for(uint256 j = 0; j < _owners.length; j++) {
            ownerByAddress[_owners[j]] = true;
        }
        owners = _owners;
        emit SetOwners(_owners);
    }

    function getOwners() public constant returns (address[]) {
        return owners;
    }
}

contract Pausable is MultiOwnable {

    int public endDate;

    /**
    * @dev modifier to allow actions only when the contract IS not paused
    */
    modifier whenNotPaused() {
        //require(now >= endDate);
        _;
    }
}

contract StandardToken is Token, Pausable {
    using SafeMath for uint256;
    mapping(address => mapping (address => uint256)) internal allowed;
    mapping(address => uint256) balances;

    /**
    * @dev transfer token for a specified address
    * @param _to The address to transfer to.
    * @param _value The amount to be transferred.
    */
    function transfer(address _to, uint256 _value) public whenNotPaused returns (bool) {
        require(_to != address(0));
        require(balances[msg.sender] >= _value && balances[_to].add(_value) >= balances[_to]);

        balances[msg.sender] = balances[msg.sender].sub(_value);
        balances[_to] = balances[_to].add(_value);

        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    /**
    * @dev Gets the balance of the specified address.
    * @param _owner The address to query the the balance of.
    * @return An uint256 representing the amount owned by the passed address.
    */
    function balanceOf(address _owner) public constant returns (uint256 balance) {
        return balances[_owner];
    }


    /**
    * @dev Transfer tokens from one address to another
    * @param _from address The address which you want to send tokens from
    * @param _to address The address which you want to transfer to
    * @param _value uint256 the amount of tokens to be transferred
    */
    function transferFrom(address _from, address _to, uint256 _value) public whenNotPaused returns (bool) {
        require(_to != address(0));
        require(_value <= allowed[_from][msg.sender]);

        balances[_from] = balances[_from].sub(_value);
        balances[_to] = balances[_to].add(_value);
        allowed[_from][msg.sender] = allowed[_from][msg.sender].sub(_value);

        emit Transfer(_from, _to, _value);
        return true;
    }

    /**
    * @dev Approve the passed address to spend the specified amount of tokens on behalf of msg.sender.
    *
    * Beware that changing an allowance with this method brings the risk that someone may use both the old
    * and the new allowance by unfortunate transaction ordering. One possible solution to mitigate this
    * race condition is to first reduce the spender's allowance to 0 and set the desired value afterwards:
    * https://github.com/ethereum/EIPs/issues/20#issuecomment-263524729
    * @param _spender The address which will spend the funds.
    * @param _value The amount of tokens to be spent.
    */
    function approve(address _spender, uint256 _value) public returns (bool) {
        allowed[msg.sender][_spender] = _value;

        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    /**
    * @dev Function to check the amount of tokens that an owner allowed to a spender.
    * @param _owner address The address which owns the funds.
    * @param _spender address The address which will spend the funds.
    * @return A uint256 specifying the amount of tokens still available for the spender.
    */
    function allowance(address _owner, address _spender) public constant returns (uint256 remaining) {
        return allowed[_owner][_spender];
    }

    /**
    * approve should be called when allowed[_spender] == 0. To increment
    * allowed value is better to use this function to avoid 2 calls (and wait until
    * the first transaction is mined)
    * From MonolithDAO Token.sol
    */
    function increaseApproval(address _spender, uint256 _addedValue) public returns (bool success) {
        allowed[msg.sender][_spender] = allowed[msg.sender][_spender].add(_addedValue);

        emit Approval(msg.sender, _spender, allowed[msg.sender][_spender]);
        return true;
    }

    function decreaseApproval(address _spender, uint256 _subtractedValue) public returns (bool success) {
        uint256 oldValue = allowed[msg.sender][_spender];

        if (_subtractedValue > oldValue) {
          allowed[msg.sender][_spender] = 0;
        } else {
          allowed[msg.sender][_spender] = oldValue.sub(_subtractedValue);
        }

        emit Approval(msg.sender, _spender, allowed[msg.sender][_spender]);
        return true;
    }
}

contract Dapp {
    //transfer all profit to token contract
    function pushToBank() public pure {}
    //return total profit of dapp since deployed
    function getProfit() public pure returns(uint256) {} 
}

contract SPToken is StandardToken {
    using SafeMath for int;
    string public constant name = "Share Profit Token";
    string public constant symbol = "SP";
    uint256 public constant INITIAL_SUPPLY = 1000000000;
    //uint256 public constant END_DATE = 1532490600; // should be 1532490600 in mainnet
    address public tokenWallet;
    address public manager;

    //List of Dapps Contract
    //all Dapps got a public function called pushToBank and holdingProfit
    //which transfer all current Profit to this Contract - tokenHolder
    address[] public dapps;
    mapping(address => bool) public accepted;
    mapping(address => int256) public credit;

    //Modifiers

    modifier onlyManager() {
        require(msg.sender == manager);
        _;
    }

    event profitClaimSuccess(address _address, uint256 _amount);
    event profitCollectSuccess(address _address);

    constructor(address _tokenOwner) public {
        totalSupply = INITIAL_SUPPLY;
        tokenWallet = _tokenOwner;
        manager = _tokenOwner; 
        balances[tokenWallet] = totalSupply;
        emit Transfer(0x0, tokenWallet, balances[tokenWallet]);
    }


    function () public payable {
    }

    function getBalance() public view returns(uint256){
        return address(this).balance;
    }

    function addContract(address _address) public onlyManager {
        dapps.push(_address);
        accepted[_address] = true;
    }

    function profitCollect() public {
        Dapp dapp;
        for (uint256 i= 0; i < dapps.length; i++)
        if (accepted[dapps[i]])
        {
            dapp = Dapp(dapps[i]);
            dapp.pushToBank(); // send profit from this dapp to tokenHolder(Bank)
        }
        emit profitCollectSuccess(msg.sender);
    }

    function profitClaim() public {
        address sender= msg.sender;
        int256 claimAmount= getClaimableAmount();
        //.add(credit[sender]);
        //W: claimAmount, P: totalProfit, t: balances[msg.sender] / totalSupply, C: credit[msg.sender];
        //W= Pt + C
        require(claimAmount > 0);
        //if not enough to pay, collect profit
        require(uint256(claimAmount) <= address(this).balance);
        credit[sender]= credit[sender].sub(claimAmount);
        sender.transfer(uint256(claimAmount));
        emit profitClaimSuccess(sender, uint256(claimAmount));
    }

    function transfer(address _to, uint256 _value) public returns (bool) {
        require(_to != address(0));
        require(balances[msg.sender] >= _value && balances[_to].add(_value) >= balances[_to]);
        uint256 totalProfit= getTotalProfit();
        address _from= msg.sender;
        //P: totalProfit, t: _amount / totalSupply, Sx: Balances[x] / totalSupply, Cx: credit[x]
        //x: _from, y: _to
        //transfer t% token from x to y
        //Cx= Cx + Pt
        //Cy= Cy + Pt
        //Sx= Sx - t 
        //Sy= Sy + t
        credit[_from]= credit[_from].add(int256(totalProfit.mul(_value).div(totalSupply)));
        credit[_to]= credit[_to].sub(int256(totalProfit.mul(_value).div(totalSupply)));
        balances[_from]= balances[_from].sub(_value);
        balances[_to]= balances[_to].add(_value);
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function getTokenAmount() public view returns(uint256){
        return balances[msg.sender];
    }

    function getProfitByAddress(address _address) public pure returns(uint256) {
        return Dapp(_address).getProfit();
    }

    function getTotalProfit() public view returns(uint256) {
        uint256 result= 0;
        for (uint256 i= 0; i < dapps.length; i++) {
            result = result.add(getProfitByAddress(dapps[i]));
        }
        return result;
    }

    function getClaimableAmount() public view returns(int256) {
        address sender = msg.sender;
        uint256 totalProfit= getTotalProfit();
        uint256 claimAmount= totalProfit.mul(balances[sender]).div(totalSupply);
        //return int256(claimAmount.add(credit[sender]));
        return int256(claimAmount) + credit[sender];
    }
}

